package com.test;

import java.io.*;
import java.util.*;
import java.text.*;
import java.math.*;
import java.util.regex.*;

public class StringAna {
	
    public static int numberNeeded(String first, String second) {
          	if(first == null) {
    		return second==null?0:second.length();
    	}else if(second == null) {
    		return first==null?0:first.length();
    	}else {//we got both non null inputs
    		char[] ip1 = first.toCharArray();
    		char[] ip2 = second.toCharArray();
    		
    		int numNeeded = ip1.length + ip2.length;
    		
    		for(int i = 0; i < ip1.length; i++) {// O(n2)
    			for(int j = 0; j< ip2.length; j++) {
    				if(ip1[i] == ip2[j] && ip1[i] != 'X' && ip2[j] != 'X' ) {
    					ip1[i] = 'X';
    					ip2[j] = 'X';
    					numNeeded -= 2;
    					break;
    				}
    			}
    		}
    		
    		return numNeeded;
    	}
    	
    }
    
    public static int numberNeeded2(String first, String second) {
    	if(first == null) {
    		return second==null?0:second.length();
    	}else if(second == null) {
    		return first==null?0:first.length();
    	}else {//we got both non null inputs
    		char[] ip1 = first.toCharArray();
    		char[] ip2 = second.toCharArray();

    		int numNeeded = 0;

    		int[] hashMap1 = new int[26];
    		int[] hashMap2 = new int[26];

    		for(char c: ip1) {
    			hashMap1[c-'a']++;
    		}

    		for(char c: ip2) {
    			hashMap2[c-'a']++;
    		}

    		for(int i= 0; i < 26 ; i++) {
    			numNeeded += (hashMap1[i] - hashMap2[i]) < 0 ? -1 * (hashMap1[i] - hashMap2[i]) : (hashMap1[i] - hashMap2[i]);
    		}

    		return numNeeded;
    	}
	
}
  
    public static void main(String[] args) {
      //  Scanner in = new Scanner(System.in);
        String a = "abcdqwe";
        String b = "cded";
        
        a="";
        b="";
        
        System.out.println(numberNeeded(a, b));
        System.out.println(numberNeeded2(a, b));
    }
}
